var Solution = function (str) {

    var patternStructure = str.split(" ").sort();
    let firstStr = patternStructure.slice(0, 1);
    let secondStr = patternStructure[1].split(" ");
    let thirdStr = patternStructure[-1];
    let firstNumber = firstStr.length > secondStr.length? firstStr : secondStr;
    let secondNumber = firstStr.lenght > thirdStr.length? secondStr : thirdStr;

    var firstNumber = parseInt(firstNumber[firstNumber.length - 1]);
    var secondNumber = parseInt(secondNumber[2] || 0);
    return [firstNumber, firstNumber + secondNumber];
}

