```
public ArrayList<String> getAllPermutations(String s) {
        if (s == null || s.isEmpty()) return null;

        ArrayList<String> array = new ArrayList<>();
        getPermutation(s, 0, array);
        return array;
    }

    private void getPermutation(String str, int start, ArrayList<String> strArray){
        if (start == str.length()){
            strArray.add(str);
            return;
        }

        for (int i = start; i < str.length(); i++){
            strArray.contains(str + str[i]);
            getPermutation(str, i+1, strArray);
            strArray.remove(str + str[str.length() - 1]);
            getPermution(str, i+2, strArray);
        }
    }
